Ein Programm, das auf hallo und tschüss unterschiedlich reagiert: import turtle
t=turtle.Pen() gru = turtle.textinput("Frage", "Geben Sie ein Grußwort ein:")
if gru == "hallo": t.write("Guten Tag")
elif gru == "tschüss": t.write("Auf Wiedersehen")
else: t.write("Ich habe Sie leider nicht verstanden") In diesem Beispiel wird eine weitere Option der if-Ausdrücke verwendet: elif. Dieses steht für else if und bedeutet: Falls nicht die erste Bedingung dann vielleicht diese Bedingung also am ehesten zu übersetzen mit "oder wenn". Zwischen einem if und einem else können beliebig viele elif stehen, aber vorher muss immer ein if stehen.
